PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `cast` (
  `id` INTEGER NOT NULL CONSTRAINT pk_cast PRIMARY KEY AUTOINCREMENT,
  `movieId` INTEGER NOT NULL
      constraint fk_cast_movie
          references movie
          on delete cascade,
  `peopleId` INTEGER NOT NULL
      constraint fk_cast_people
          references people,
  `role` varchar(255) NOT NULL,
  `orderIndex` INTEGER NOT NULL
);
CREATE TABLE `genre` (
  `id` INTEGER NOT NULL CONSTRAINT pk_genre PRIMARY KEY AUTOINCREMENT,
  `name` varchar(255) NOT NULL
);
CREATE TABLE `image` (
  `id` INTEGER NOT NULL CONSTRAINT pk_image PRIMARY KEY AUTOINCREMENT,
  `jpeg` longblob NOT NULL
);
CREATE TABLE `movie` (
  `id` INTEGER NOT NULL CONSTRAINT pk_movie PRIMARY KEY AUTOINCREMENT,
  `posterId` INTEGER DEFAULT NULL
      constraint fk_movie_image
          references image,
  `originalLanguage` varchar(10) NOT NULL,
  `originalTitle` varchar(255) NOT NULL,
  `overview` longtext NOT NULL,
  `releaseDate` date NOT NULL,
  `runtime` INTEGER NOT NULL,
  `tagline` longtext NOT NULL,
  `title` varchar(255) NOT NULL
);
CREATE TABLE `movie_genre` (
  `movieId` INTEGER NOT NULL
      constraint fk_movie_genre_movie
          references movie
          on delete cascade,
  `genreId` INTEGER NOT NULL
      constraint fk_movie_genre_genre
          references genre
          on delete cascade
);
CREATE TABLE `people` (
  `id` INTEGER NOT NULL CONSTRAINT pk_people PRIMARY KEY AUTOINCREMENT,
  `avatarId` INTEGER DEFAULT NULL
      constraint fk_people_image
          references image,
  `birthday` date DEFAULT NULL,
  `deathday` date DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `biography` longtext DEFAULT NULL,
  `placeOfBirth` varchar(255) DEFAULT NULL
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_cast_movie
    on cast (movieId);
CREATE INDEX idx_cast_people
    on cast (peopleId);
CREATE INDEX idx_movie_image
    on movie (posterId);
CREATE INDEX idx_movie_genre_movie
    on movie_genre (movieId);
CREATE INDEX idx_movie_genre
    on movie_genre (genreId);
CREATE INDEX idx_people_image
    on people (avatarId);
COMMIT;
