INSERT INTO movie VALUES(108,7371,'fr','Trois couleurs : Bleu','Après la mort de son mari, compositeur réputé, et de leur fille dans un accident de voiture, Julie commence une nouvelle vie, coupant tout lien avec son passé. Ex-assistant du couple, Olivier, amoureux d''elle, tente de l''inciter à terminer le Concerto pour l''Europe.','1993-09-08',100,'','Trois couleurs : Bleu');
INSERT INTO movie VALUES(109,7373,'fr','Trois couleurs : Blanc','Karol a tout perdu après son divorce avec Dominique, il ne peut même pas retourner en Pologne et refuse de devenir meurtrier pour de l''argent. Après avoir enfin réussi à retourner dans son pays, il se lance dans diverses entreprises et tombe dans le piège de sa vengeance sur Dominique.','1994-01-26',100,'','Trois couleurs : Blanc');
INSERT INTO movie VALUES(110,7369,'fr','Trois couleurs : Rouge','Valentine, étudiante à Genève et mannequin à ses heures, passe son temps à attendre les appels téléphoniques de son petit ami, Michel, qui vit en Angleterre. Auguste, son voisin, épris de la douce Karin, travaille d''arrache-pied pour devenir avocat. Sans le savoir, tout ce petit monde a été placé sur écoute par un juge à la retraite, acariâtre et cynique, qui occupe ainsi sa misanthropie et ses vieux jours. Parce qu''au volant de sa voiture, elle a renversé la chienne du juge, Valentine fait la connaissance du vieux grigou et découvre ses basses manies. Dégoûtée autant que fascinée, elle se met à lui rendre de fréquentes visites...','1994-05-27',100,'','Trois couleurs : Rouge');
INSERT INTO movie VALUES(630,16044,'en','The Wizard of Oz','Dorothy Gale, une jeune orpheline, est élevée dans une ferme du Kansas tenue par sa tante et son oncle. Son chien Toto étant persécuté par la méchante Almira Gulch, Dorothy demande aux trois ouvriers de la ferme de le protéger. Cependant personne ne semble prendre au sérieux les craintes de la jeune fille. Almira Gulch finit par s''emparer de Toto avec l''intention de le tuer. Mais le chien s''échappe et retourne près de Dorothy qui décide alors de s''enfuir. Arrivée à la ferme, une tornade se forme avant que Dorothy ne puisse se réfugier dans la cave...','1939-08-15',101,'Une éblouissante fantaisie en couleurs !','Le Magicien d''Oz');
INSERT INTO movie VALUES(503314,7628,'ja','ドラゴンボール超スーパー ブロリー','Quelque temps après le Tournoi du Pouvoir, la Terre est paisible. Son Goku et ses amis ont repris leur vie. Cependant, avec son expérience du Tournoi, Son Goku passe son temps à s''entraîner pour continuer à s''améliorer car ce dernier est conscient qu''il reste encore beaucoup d''individus plus forts à découvrir au sein des autres univers. Lorsqu''un jour, le vaisseau de Freezer refait surface sur la Terre. Celui-ci est accompagné d''un Saiyan, nommé Broly, avec son père, Paragus. La surprise de Son Goku et Vegeta est immense puisque les Saiyans sont censés avoir été complètement anéantis lors de la destruction de la planète Vegeta. Ils n''ont donc pas d''autre choix que de s''affronter, mais ce nouvel ennemi s''adapte très vite aux adversaires qu''il affronte…','2018-12-14',100,'Goku et Vegeta font face à un nouvel ennemi, le Super Saïyen Légendaire Broly !','Dragon Ball Super - Broly');
