INSERT INTO people VALUES(1137,7899,'1964-03-09',NULL,'Juliette Binoche','Juliette Binoche, est une actrice française, née le 9 mars 1964 à Paris.\n\nElle est la première actrice à avoir remporté (et la seule à ce jour avec Julianne Moore) un prix d''interprétation dans les trois plus grands festivals de cinéma — Cannes, Venise et Berlin. De plus, elle a reçu le César de la meilleure actrice, pour sa performance dans Trois couleurs : Bleu, ainsi que l''Oscar de la meilleure actrice dans un second rôle et le BAFTA pour son rôle dans Le Patient anglais.','Paris, France');
INSERT INTO people VALUES(1138,7900,'1953-08-19','1994-10-22','Benoît Régent','Après le cours Périmony, Benoît Régent, admis au Conservatoire national supérieur d''art dramatique de Paris, suit l''enseignement d''Antoine Vitez et de Jean-Paul Roussillon. Il débute sur scène en 1970 dans Tête d''or de Paul Claudel, mis en scène par Denis Llorca. Il intègre ensuite, avec d''autres débutants comme Thierry Fortineau et Christophe Malavoy, la troupe du jeune metteur en scène américain Stuart Seide pour jouer Troïlus et Cressida de Shakespeare en 1974 et Dommage qu''elle soit une putain de John Ford. Le succès de ces spectacles montés avec très peu de moyens lance la carrière de ces jeunes gens. En 1981, Patrice Chéreau le dirige au théâtre dans Peer Gynt de Henrik Ibsen, puis en 1983 dans Les Paravents de Jean Genet.\n\nAu cinéma longtemps cantonné dans des rôles secondaires, il est remarqué dans La Diagonale du fou de Richard Dembo qui lui vaut une nomination au César du meilleur espoir masculin en 1985. Il accède enfin aux rôles importants avec des films comme Une flamme dans mon cœur (1986) d''Alain Tanner, La Bande des quatre (1988) de Jacques Rivette, J''entends plus la guitare de Philippe Garrel. Il obtient une plus grande reconnaissance critique et publique en apparaissant dans Trois couleurs : Bleu de Krzysztof Kieslowski, puis ...à la campagne de Manuel Poirier. Mais Benoît Régent meurt prématurément d''une rupture d''anévrisme, à la fin du tournage de Noir comme le souvenir de Jean-Pierre Mocky en 1994','');
INSERT INTO people VALUES(1139,7901,'1966-06-30',NULL,'Florence Pernel','Florence Pernel débute sa carrière d’actrice à l''âge de 10 ans dans le téléfilm Plein soleil. A 14 ans, elle apparait pour la première fois sur le grand écran dans le film Girls, de Just Jaeckin, photographe et réalisateur du film érotique Emmanuelle.  En 1981, à seulement 15 ans, elle est nommée aux Césars dans la catégorie \"Meilleur espoir féminin\" pour son rôle dans  Que les gros salaires lèvent le doigt !. Elle n''abandonne pas pour autant ces études et délaisse alors le cinéma. On la retouve en 1989 dans Mauvaise fille avec Yvan Attal, et elle enchaîne ensuite les rôles secondaires dont celui de Sandrine dans Trois couleurs - Bleu, de Krzysztof Kieslowski en compagnie de Juliette Binoche, en 1993. Son interprétation lui vaut une deuxième nomination au César du \"Meilleur espoir féminin\".  Elle décroche en 1993, l’un des rôles les plus marquants de sa carrière celui du juge Larrieu dans la série  Le juge est une femme . Entre deux épisodes, elle continue sa carrière au cinéma avec notamment Vive la République ! d’Eric Rochant avec Gad Elmaleh, Roschdy Zem et Hippolyte Girardot et le succès populaire La Vache et le Président en 1999.  Florence Pernel s’essaie aussi au théâtre dans  Un tramway nommé Désir, pour lequel elle est nommée aux Molières. Dès lors, elle multiplie les rôles sur scène, et décroche, en 2002, sa deuxième nomination aux Molières, pour La Boutique au coin de la rue. La même année, après 17 épisodes tournés en 9 ans, elle quitte Le juge est une femme. Elle reste tout de même présente sur le petit écran puisqu''elle joue dans de nombreux téléfilms comme : Lagardereavec Bruno Wolkowitch, Jaurès, la naissance d’un géant avec Philippe Torreton ou encore Monsieur Léon avec Michel Serrault. Elle est aussi présente au casting de grandes sagas comme Les Thibault ou Le Clan Pasquier. En 2007, elle tient le rôle mémorable de Marie Humbert dans Marie Humbert, le secret d''une mère, téléfilm qui a reçu le Grand Prix du jury du festival de Luchon.  Elle revient ensuite de façon régulière à la télévision dans  Mes amis, mes amours, mes emmerdes. Simultanément, elle apparaît aussi sur le grand écran en tant que Mme Dumas dans L'' Autre Dumas aux côté de Gérard Depardieu et Benoît Poelvoorde. En 2011, Florence Pernel est Cécilia Sarkozy dans La Conquête, le film-événement de Xavier Durringer. A noter que le scénario est écrit par son compagnon l''historien Patrick Rotman.',' Paris, France');
