INSERT INTO people VALUES(1141,7903,'1943-09-09',NULL,'Hélène Vincent','Jocelyne-Hélène Nain dite Hélène Vincent est une actrice et metteur en scène française née le 9 septembre 1943 à Paris.\n\nSon nom de jeune fille est Jocelyne-Hélène Nain. Elle a été élève au cours Raymond-Girard. Hélène Vincent s''est fait connaître du grand public par son rôle de Mme Le Quesnoy dans La vie est un long fleuve tranquille d''Étienne Chatiliez. Elle a été mariée au comédien et metteur en scène Jean-Pierre Vincent et est la mère du réalisateur Thomas Vincent.\n\nSource: Article \"Hélène Vincent\" de Wikipédia en français, soumis à la licence CC-BY-SA 3.0.','Paris, France');
INSERT INTO people VALUES(1142,7904,'1959-03-23','2005-04-13','Philippe Volter','Philippe Volter, né le 23 mars 1959 à Uccle et mort le 13 avril 2005 à Neuilly-sur-Marne, est un acteur belge.\n\nFils du metteur en scène Claude Volter et de la comédienne Jacqueline Bir, Philippe Volter a fait ses premiers pas sur une scène à quatre ans. Il a reçu l''Ève du Théâtre en 1984. Il s''installe ensuite en France, où il fait carrière au cinéma. En 2002, après le décès de son père, il reprend la direction du théâtre bruxellois fondé par ce dernier, la Comédie Claude Volter. Il en démissionne deux ans plus tard.\n\nIl se suicide à Paris en 2005.\n\nSource: Article \"Philippe Volter\" de Wikipédia en français, soumis à la licence CC-BY-SA 3.0.','Uccle, Belgium');
