INSERT INTO people VALUES(1350,7927,'1966-07-15',NULL,'Irène Jacob','Irène Jacob est une actrice franco-suisse née le 15 juillet 1966 à Suresnes (Hauts-de-Seine).\n\nIrène Marie Jacob est née à Suresnes près de Paris. Fille du physicien Maurice Jacob, elle passe son enfance à Genève, en Suisse, où ses parents s''installent alors qu''elle n''a que 3 ans. Elle a trois frères. Pendant son temps en Suisse, elle fréquente le Conservatoire de musique de Genève. Passionnée par le théâtre, elle revient à Paris en 1984, l''année de ses 18 ans. Elle doit sa première apparition au cinéma à Louis Malle qui lui confie le rôle d''une professeur de piano pour quelques scènes du film Au revoir les enfants en 1987. L''année suivante, Jacques Rivette la retient pour un petit rôle dans La Bande des quatre.\n\nEn 1991, Irène Jacob incarne l''héroïne de La Double Vie de Véronique de Krzysztof Kieślowski. Pour ce rôle, elle obtient le prix d''interprétation féminine à Cannes. Elle a alors 24 ans. En 1993, le réalisateur polonais lui confie le premier rôle féminin de Valentine de Rouge, le dernier volet de Trois couleurs. Elle y donne la réplique à Jean-Louis Trintignant et y côtoie Juliette Binoche et Julie Delpy, les héroïnes de Bleu et Blanc, dans la scène finale.\n\nMalgré la reconnaissance de la critique, son début de carrière est consacré à des films confidentiels. Polyglotte, Irène Jacob se construit, dans un second temps, une carrière internationale. C''est ainsi qu''elle joue sous la direction de Michelangelo Antonioni et Wim Wenders dans Par-delà les nuages en 1995, et obtient un rôle dans US Marshals aux côtés de Tommy Lee Jones et Wesley Snipes. L''année suivante, elle apparait, sportive et sexy portant un pantalon de cuir noir, dans un film d''espionnage finlandais Spy Games en jeune et ambitieuse recrue du KGB. Par ailleurs, elle n''oublie pas le théâtre où elle concrétise quelques projets.\n\nSa filmographie est très éclectique allant du drame à la comédie en passant par les films d''action, sous la caméra de réalisateurs de toute nationalité, reconnus ou confidentiels.\n\nParallèlement à sa carrière de comédienne, elle a également chanté en duo avec, entre autres, Vincent Delerm et avec l’Orchestre national de jazz. Irène Jacob est également la voix française de l''attraction Studio Tram Tour: Behind the Magic à Disneyland Paris, dans le parc Walt Disney Studios.\n\nEn 2011, Irène Jacob a sorti un album Je sais nager, composé avec son frère Francis Jacob, guitariste de jazz. Le duo est finaliste du 1er prix Georges-Moustaki.\n\nLe chanteur Jean-Luc Le Ténia lui a dédié une chanson intitulée Irène Jacob sur son album L''Amour et/ou la Poésie.\n\nEn 2019, elle publie son premier roman, Big Bang, chez Albin Michel4.\n\nLe 30 septembre 2021, Irène Jacob est élue à l’unanimité par le Conseil d’administration de l’Institut Lumière Présidente de L''institut Lumière de Lyon, succédant ainsi à Bertrand Tavernier décédé en Mars 2021 et qui occupait le poste depuis 1982.\n\nIrène Jacob est mariée au comédien Jérôme Kircher depuis 2000. Ils ont deux fils, Paul né en 2002 et Samuel né en 2005.\n\nSource: Article \"Irène Jacob\" de Wikipédia en français, soumis à la licence CC-BY-SA 3.0.','Suresnes, Hauts-de-Seine, France');
INSERT INTO people VALUES(1352,7928,'1930-12-11','2022-06-17','Jean-Louis Trintignant','Neveu du coureur automobile Maurice Trintignant, qui lui a transmis sa passion, le jeune Jean-Louis Trintignant suit des études de droit à la faculté d''Aix-en-Provence. Mais il assiste le jour de ses 19 ans à une représentation théâtrale qui changera sa vie : L''Avare, mis en scène par Charles Dullin, dont il décide de suivre les cours à Paris. Jeune premier qui débute sur les planches en 1951 avec la pièce A chacun selon sa faim, le comédien se fait rapidement remarquer, grâce notamment à Responsabilité limitée, un texte de Robert Hossein, en 1953. Il fait à cette époque un bref passage par l''IDHEC, avec pour ambition de devenir réalisateur - un désir qui ne se concrétisera que vingt ans plus tard.\n\nAprès quelques figurations, le premier film dans lequel apparaît Jean-Louis Trintignant est Si tous les gars du monde en 1955, mais celui qui le révèle est Et Dieu créa la femme de Vadim, drame au parfum de scandale qui lance le mythe Bardot. Très marqué par ses deux ans de service militaire en Algérie, il trouve un de ses premiers grands rôles en 1961 dans Le Combat dans l''ile, œuvre engagée de Cavalier. Son goût pour les personnages ambigus lui fera d''ailleurs tourner plusieurs grands films politiques, de Z de Costa-Gavras (sa composition de juge lui vaut le Prix d''interprétation à Cannes en 1969) au Conformiste de Bertolucci - un des sommets de sa carrière italienne, qui compte aussi Le Fanfaron de Risi ou La Terrasse de Scola.','Piolenc, Vaucluse, France');
