INSERT INTO people VALUES(19075,7915,'1944-03-02',NULL,'Philippe Morier-Genoud','Philippe Morier-Genoud est un acteur de théâtre et de cinéma français, né le 2 mars 1944 à Thonon-les-Bains. Il a travaillé successivement à Grenoble (CDNA) ensuite à Lyon au côté de Roger Planchon (TNP), puis à l''Odéon-Théâtre de l''Europe, où il fut acteur permanent de la troupe de Georges Lavaudant de 1995 à 2005.\n\nIl poursuit également une carrière au cinéma qu''il a commencée avec François Truffaut en 1981. Il est à remarquer qu''il a interprété deux fois dans sa carrière le Docteur Cottard, personnage de Marcel Proust: dans un film de Raoul Ruiz en 1998 et un téléfilm de Nina Companeez diffusé en 2011.\n\nSource: Article \"Philippe Morier-Genoud\" de Wikipédia en français, soumis à la licence CC-BY-SA 3.0.','Thonon-les-Bains, Haute-Savoie, France');
