INSERT INTO people VALUES(37628,7908,'1972-06-03',NULL,'Julie Gayet','Julie Gayet, née le 3 juin 1972 à Suresnes, est une actrice et productrice de cinéma française.\n\nElle commence sa carrière à l''écran durant les années 1990 et se fait notamment connaître en interprétant le premier rôle féminin dans le film Delphine 1, Yvan 0 de Dominique Farrugia. Elle se lance dans la production en 2007. Elle a notamment été nommée une fois au César de la meilleure actrice dans un second rôle pour Quai d''Orsay en 2014.\n\nDepuis 2013, elle est la compagne de François Hollande, président de la République française de 2012 à 2017. Leur relation n''est toutefois pas officialisée ; n''étant pas considérée comme étant la compagne du président de façon formelle, elle n''est pas apparue en public à ses côtés de manière officielle pendant son mandat présidentiel.','Suresnes, Hauts-de-Seine, France');
