INSERT INTO people VALUES(267962,7907,'1927-02-24','2017-01-27','Emmanuelle Riva','Paulette Germaine Riva, dite Emmanuelle Riva, est une actrice de cinéma et de théâtre et poète française née le 24 février 1927 à Cheniménil (Vosges) et morte le 27 janvier 2017 à Paris XVIe.\n\nElle est révélée en 1959 par Alain Resnais qui lui donne le rôle principal de son premier long métrage, Hiroshima mon amour. En 2013, à la suite de son interprétation dans Amour, elle obtient le César de la meilleure actrice, puis une nomination aux Oscars. ...\n\nSource: Article \"Emmanuelle Riva\" de Wikipédia en français, soumis à la licence CC-BY-SA 3.0.','Cheniménil, Vosges, France');
